import React, { useState } from "react";

const DAYS = [
  "Monday",
  "Tuesday",
  "Wednesday",
  "Thursday",
  "Friday",
  "Saturday",
  "Sunday"
];

export default function CalendarSettings() {
  const [workingDays, setWorkingDays] = useState([
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday"
  ]);

  const [openTime, setOpenTime] = useState("09:00");
  const [closeTime, setCloseTime] = useState("21:00");
  const [slotDuration, setSlotDuration] = useState(30);

  const [allowAppointments, setAllowAppointments] = useState(true);
  const [allowWalkins, setAllowWalkins] = useState(true);

  const toggleDay = day => {
    setWorkingDays(prev =>
      prev.includes(day)
        ? prev.filter(d => d !== day)
        : [...prev, day]
    );
  };

  const handleSave = () => {
    alert("Calendar settings saved (mock)");
  };

  return (
    <div className="card">
      <h3>Calendar Settings</h3>

      {/* Working Days */}
      <div className="form-group">
        <label>Working Days</label>
        <div style={{ display: "flex", gap: 8, flexWrap: "wrap" }}>
          {DAYS.map(day => (
            <button
              key={day}
              type="button"
              onClick={() => toggleDay(day)}
              style={{
                padding: "6px 10px",
                border: "1px solid #ff4d00",
                background: workingDays.includes(day)
                  ? "#ff4d00"
                  : "transparent",
                color: workingDays.includes(day) ? "#fff" : "#000",
                cursor: "pointer"
              }}
            >
              {day.slice(0, 3)}
            </button>
          ))}
        </div>
      </div>

      {/* Time Settings */}
      <div className="form-row">
        <div className="form-group">
          <label>Opening Time</label>
          <input
            type="time"
            value={openTime}
            onChange={e => setOpenTime(e.target.value)}
          />
        </div>

        <div className="form-group">
          <label>Closing Time</label>
          <input
            type="time"
            value={closeTime}
            onChange={e => setCloseTime(e.target.value)}
          />
        </div>
      </div>

      {/* Slot Duration */}
      <div className="form-group">
        <label>Slot Duration (minutes)</label>
        <select
          value={slotDuration}
          onChange={e => setSlotDuration(Number(e.target.value))}
        >
          <option value={15}>15</option>
          <option value={30}>30</option>
          <option value={45}>45</option>
          <option value={60}>60</option>
        </select>
      </div>

      {/* Toggles */}
      <div className="form-row">
        <label>
          <input
            type="checkbox"
            checked={allowAppointments}
            onChange={() => setAllowAppointments(!allowAppointments)}
          />
          &nbsp; Allow Appointments
        </label>

        <label>
          <input
            type="checkbox"
            checked={allowWalkins}
            onChange={() => setAllowWalkins(!allowWalkins)}
          />
          &nbsp; Allow Walk-ins
        </label>
      </div>

      <button className="btn-primary" onClick={handleSave}>
        Save Settings
      </button>
    </div>
  );
}
